Bridge.assembly("Bridge.Spaf",function(){"use strict";Bridge.define("Bridge.Spaf.SpafUtility",{statics:{getElementById:function(T,id){return Bridge.cast($(System.String.format("#{0}",id)).get(0),T)},getTemplate:function(T,templateId){var template=$(System.String.format("#{0}",templateId)).html().trim(),singleElement=System.Linq.Enumerable.from($.parseHTML(template)).single();return Bridge.cast(singleElement,T)}}})});